import React, { useState } from 'react';
import './App.css';
import create_header from './assets/components/header';
import back_image from './assets/components/background';

function App() {
    return (
      <div className="App">
        <div className="background" style={{ backgroundAttachment: 'scroll' }}>
            <img src={back_image} alt="back" className="background-image" />
        <header className="App-header">
            {create_header()}
        
        </header>
        </div>
      </div>
    );
  }
export default App;
